import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Tudo from './Pages/Tudo';

function App() {
  return (
    <>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Tdo/>} />
          </Routes>
        </BrowserRouter>

    </>
  );
}

export default App;
